More likely. The reason that you want to open google flights and check the flights availability is because you are looking for information about which flights would be available during your desired travel dates so as to help determine whether to book those flights or not. If no such flights exist or their schedule doesn't meet your need, then you may cancel them, in case they have that option, or choose another set of dates/flight. Either way, checking the availability makes you more likely to know whether there's an opportunity to do any refunding later on. However, even without checking the availability, since some airlines offer free cancellation or refund within 24 hours after purchasing a ticket, you still stand a chance to get a full or partial refund (depending on when you purchase). In addition, sometimes tickets could also be exchanged for other ones but with different price/schedule or even destinations. Some conditions might apply though depending on the type of ticket and the specific policies of the company operating the ticket.

By the way, before committing yourself into buying a ticket online, especially for long-haul trips like flying across Pacific Ocean, you may first consider these aspects:
1) Check visa requirements and make sure you meet all of them ahead of time for both your origin country and destination countries; otherwise, your trip may end up being either delayed, shortened, or even canceled;
2) Book accommodation(s), transportation between your accommodation and airport, and maybe some attraction spots nearby where you plan to go, especially for those tours that require reservation well ahead of time;
